('UCFlGSuyqfui9DwttuET8MzQ', 'czy nas pika', 'https://yt3.ggpht.com/a-/AN66SAxokLp7wWsUvOyvAjln1Rmx1vMYyl6V5x4k7A=s240-mo-c-c0xffffffff-rj-k-no', 'Oficjalny kana Polskiego Zwizku Piki Nonej - materiay filmowe ze zgrupowa reprezentacji Polski: kulisy, reportae, relacje, skrty meczw, bramki, treningi, wywiady, konferencje prasowe, cykl materiaw Eksperckie Studio. \n\nOfficial channel of the Polish Football Association - footages from the Polish National Team''s training camps: behind the scenes, coverages, recaps, goals, training sessions, interviews, press conferences and more.', 601595, 0, '', 3142342, 0, 80997, 3111, 6259, 0, 'https://www.facebook.com/LaczyNasPilka', 'http://instagram.com/laczynaspilka#', 'https://twitter.com/laczynaspilka', 'PL'),
('UCFmaQ3okrfyHcDElrf2gGtg', 'AdwokaciZwierzat', 'https://yt3.ggpht.com/a-/AN66SAxJt_-gLueaLE8IegnDHa8CjTjHg5kOFgJF7Q=s240-mo-c-c0xffffffff-rj-k-no', 'ADWOKACI ZWIERZT - PROGRAM, JAKIEGO W POLSCE JESZCZE NIE BYO! \n\nJestemy ludmi czynnie zaangaowanymi w ochron i pomoc zwierztom. Nie godzimy si na ich okrutne traktowanie. Tym mocniej boli nas fakt ignorowania ich praw przez polski wymiar sprawiedliwoci. Jest to program naszej rodzimej produkcji, cho wykorzystamy niektre materiay filmowe zagranicznych organizacji, to jednak nie jest on na adnej licencji, adn kopi zagranicznej produkcji. ORYGINALNY POLSKI PROGRAM, na ktry pomys narodzi si wiosn 2010 r. \n\nCzy kierujemy nasz projekt do mionikw zwierzt? Nie tylko. \nDo kogo gwnie kierujemy nasz projekt? Do osb jedzcych miso i inne produkty pochodzenia zwierzcego, do osb niewiadomych okruciestwa wobec zwierzt oraz unikajcych tego tematu, do producentw ywnoci, kosmetykw, lekw, odziey, tytoniu i alkoholu, do Wadz RP, do osb i instytucji zaangaowanych w ochron i eksploatacj dzikiej przyrody, a take do wszystkich czynnie lub biernie zaangaowanych w rne inne formy eksploatacji zwierzt i rodowiska naturalnego. \n\nBohaterami bd zwierzta, obrocy zwierzt oraz ludzie zajmujcy si ochron przyrody, a take przedstawiciele polskiego show-biznesu, polskiej sceny politycznej oraz adwokaci, prawnicy i sdziowie. Chcemy podej do problemu ochrony praw zwierzt w Polsce w sposb kompleksowy, a zarazem ciekawy, ekscytujcy i przystpny dla widzw z rnych rodowisk spoecznych.\n\nProgram inny ni wszystkie. Bdziemy mwi o problemach wszystkich zwierzt: Zwierzta w rolnictwie, Zwierzta jako towarzysze czowieka, Zwierzta w sporcie, rozrywce i rekreacji, Dzika przyroda, Zdrowie, moda i uroda bez okruciestwa. \n\nZorganizowalimy ogromn akcj na portalach spoecznociowych. Projekt byskawicznie zdoby ogromne poparcie w cigu krtkiego czasu. Ponad 100 osb dziennie zapisuje si na nasze strony, wysya do nas zaproszenia oraz zapisuje sie do naszych grup dyskusyjnych.\n\nW poszczeglnych odcinkach programu bdziemy filmowa akcje podczas interwencji oraz pomocy przy zwierztach. Znane osoby wezm udzia w tych akcjach jako osoby towarzyszce, przygldajce si, komentujce sytuacj lub w razie moliwoci pomagajce w opiece nad zwierztami oraz uczestniczce w zabawach z nimi. Zostan zaproszeni m.in. do schronisk i orodkw rehabilitacji lub gospodarstw, gdzie dobrostan zwierzt jest najwaniejszy. Wszystko w zalenoci od profilu edycji. Zamierzamy pokaza relacje z przebiegu leczenia i rehabilitacji zwierzt z udziaem lekarzy weterynarii i rehabilitantw w placwkach dla zwierzt. Zaprosimy osoby z rnych rodowisk spoecznych, aby wyraziy swoje opinie na temat sytuacji zwierzt w Polsce.', 8, 0, '', 1532, 0, 5, 2, 0, 0, '', '', '', ''),
